import React, { Component } from "react";
import './navbar.scss'
export default class Navbar extends Component{
    render(){
        return(
        <div className="pf__title">
            <div className="pf__title--name">
                <p>Jubi  </p> 
                <p>  Chen</p>
            </div>
            <ul>
            {/* style="color:#86858A" */}
                <li >Contact</li>
                <li >Blog</li>
                <li >Services</li>
                <li >Resume</li>
                <li >Home</li>
            </ul>
     </div>)

    }
}
